import logo from './../../images/logo.png';
import './../../css/AdminLogin.css';
import React, {useState } from 'react';
import { setUserSession } from '../../utils/Common';
import axios from 'axios';
import {Alert, Button, Container, Form, FormGroup, Input} from 'reactstrap';
import loginAPI from '../../api/loginAPI';

function AdminLogin(props){
        const [adminLogin, setAdminLogin] = useState({
            username: '',
            password: '',
        })
        const [submit, setSubmit] = useState(false);

        function handleChange(event){
            const target = event.target;
            const name = target.name;
            const value = target.value;
            setAdminLogin({
                ... adminLogin,
                [name] : value,
            })
        }
        function handleSubmit(e){
            e.preventDefault();
            const {username, password} = adminLogin;
            console.log(username);
            loginAPI.loginAdmin(adminLogin).then(function(res){
                if(res.data === 'fail'){
                    setSubmit(true);
                }else{
                    setUserSession(res.data.token, res.data);
                    props.history.push('/admin-manager');
                }
            }).catch(function(error){
                console.log(error);
            })
            // axios.post('https://datnxeoffice.azurewebsites.net/api/Admins/login',{
            //     username: adminLogin.username,
            //     password: adminLogin.password
            // }).then(function(res){
            //     if(res.data ==='fail'){
            //         setSubmit(true);
            //     }else{
            //         setUserSession(res.data.token,res.data);
            //         props.history.push('/admin-manager');
            //     }
            // }).catch(function(error){
            //     console.log(error);
            // });     
        }
        return (
            <Container fluid={true}>
                <div>
                    <img src={logo} alt=""/>
                </div>
                <Form className="form-admin" onSubmit={handleSubmit}>
                    <FormGroup>
                        <Input type="text" name="username" required onChange={handleChange} placeholder="Username"/>
                    </FormGroup>
                    <FormGroup>
                        <Input type="password" name="password" required onChange={handleChange} placeholder="Password"/>
                    </FormGroup>
                    <FormGroup>
                        <Alert color="danger" isOpen={submit}>Incorrect username or password</Alert>
                    </FormGroup>
                    <FormGroup>
                        <Button type="submit" color="primary" block>Login</Button>
                    </FormGroup>
                </Form>
            </Container>
        );
    }

export default AdminLogin;
